import { RouterModule } from "@angular/router";
import { HomePageComponent } from "./app/feature/pages/home-page/home-page.component";
import { PageNotFoundPageComponent } from "./app/feature/pages/page-not-found-page/page-not-found-page.component";
const routes = [{
  path: '',
  pathMatch: 'full',
  redirectTo: 'home'
}, {
  path: 'home',
  component: HomePageComponent
}, {
  path: '**',
  component: PageNotFoundPageComponent
}];
export const AppRoutingModule = RouterModule.forRoot(routes);
